    public function getPlayers() {
        $letters = range('a', 'z');
        $array = array("errors" => 0, "new" => 0, "old" => 0, "i" => 0);
        $letters[] = "æ";
        $letters[] = "ø";
        $letters[] = "å";
        $context = "SearchPlayer";

        foreach ($letters as $letter) {
            $params = [
                "agegroupcontext" => "0",
                "agegroupid" => "",
                "callbackcontextkey" => $this->token,
                "clubid" => "1622",
                "gender" => "",
                "licenseonly" => false,
                "name" => $letter,
                "playernumber" => "",
                "searchteam" => false,
                "selectfunction" => "SPSel1",
                "tournamentdate" => "",
            ];

            $this->dom = $this->request->makePost($context, $params);

            $output = $this->parsePlayers($this->dom);
            $array["errors"] = $array["errors"] + $output["errors"];
            $array["new"] = $array["new"] + $output["new"];
            $array["old"] = $array["old"] + $output["old"];
            $array["i"] = $array["i"] + $output["i"];


        }
        return $array;

    }

    public function parsePlayers($dom) {
        $array = $dom;
        $dom = new Document($array["Html"]);
        $new = 0;
        $old = 0;
        $i = 0;
        $errors = 0;
        foreach ($dom->xpath("//tr") as $tr) {
            preg_match('#\((.*?)\)#', $tr->attr('onclick'), $match);
            $data = $match[0];
            $data = str_replace(array( '(', ')',"'"), '',$data);
            $original = $data;
            $data = explode(", ",$data);
            //print_r($data);
            if($data[1]) {
                try {
                    $player = BpPlayer::where("dbf_id", $data[1])->firstOrFail();
                    if ($player) {
                        echo $data[1] . ": ". $player->name . " - " . $data[0];
                        $player->bp_id = $data[0];
                        $player->save();
                        if ($player->wasRecentlyCreated) {
                            $new++;
                        } else {
                            $old++;
                        }
                    }
                } catch (ModelNotFoundException $e) {
                    $errors++;
                    Log::error("import:player-ids - No player found with id: " . $data[1]);
                }
            } else {
                Log::info("import:player-ids - No data :" . $original);
            }
            $i++;
        }
        $array["errors"] = $errors;
        $array["new"] = $new;
        $array["old"] = $old;
        $array["i"] = $i;
        return $array;
    }

